import React from 'react';
import { TextField} from '@material-ui/core';

const test = (props) => {
  return (
    <div>
      <TextField autoFocus margin="dense" id="email" value={props.passInput} label="Email Address" type="email" fullWidth onChange={props.echanged} />
    </div>
  )
}

export default test;
